import React , { useState }from 'react';
import { GoogleLogout } from 'react-google-login';

const clientId = '100494854374-u8q7012stasfgi3iepju6pg5he78ofqo.apps.googleusercontent.com';

function Logout(){
    
    const onSuccess = () => {
        alert('Logout made successfully');
        const [name, setName] = useState("");
    };

    return(
        <div>
            <GoogleLogout 
                clientId={clientId}
                buttonText="Logout"
                onLogoutSuccess={onSuccess}
            ></GoogleLogout>
        </div>
    );
}
export default Logout;
